<?phpnamespace Nemundo\Meteo\AviationWeather\Data\MetarStation;class MetarStationPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var MetarStationModel*/public $model;public function __construct() {parent::__construct();$this->model = new MetarStationModel();}/*** @return MetarStationRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new MetarStationRow($dataRow, $this->model);$list[] = $row;}return $list;}}